tabs.css:
* {
 border-radius: 4px;
 white-space: normal;
 word-break: normal;
 line-height: 120%;
}

widgets.script:
if(value=="Device")
{
send(false, "/device/fx/follows/device", 1)
}
else if(value=="Last_Touched")
{
send(false, "/device/fx/follows/last_touched", 1)
}
else if(value=="Focused")
{
send(false, "/device/fx/follows/focused", 1)
}

if (touch !== undefined) {
 var address = "/track/@{parent.variables.n}/volume/touch"
 send(address, touch)
}

if (touch !== undefined) {
 var address = "/track/@{parent.variables.n}/pan/touch"
 send(address, touch)
}

if (touch !== undefined) {
 var address = "/track/@{parent.variables.n}/volume/touch"
 send(address, touch)
}

